import React, { useState } from "react";
import Expenses from "./components/Expense/Expenses";
import NewExpenses from "./NewExpenses/NewExpenses";

function App() {
  // const expenses = [
  //   {
  //     id: "e1",
  //     title: "Toilet Paper",
  //     amount: 94.12,
  //     date: new Date(2020, 7, 14),
  //   },
  //   { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
  //   {
  //     id: "e3",
  //     title: "Car Insurance",
  //     amount: 294.67,
  //     date: new Date(2021, 2, 28),
  //   },
  //   {
  //     id: "e4",
  //     title: "New Desk (Wooden)",
  //     amount: 450,
  //     date: new Date(2021, 5, 12),
  //   },
  // ];

  const [expenses, setExpenses] = useState([]);

  const getNewExpenseData = (val) => {
    const expenseDate = {
      ...val,
      id: Math.random().toString(),
    };
    setExpenses((prevState) => {
      return [...prevState, expenseDate];
    });
    // console.log(expenses);
    // console.log(val);
  };

  return (
    <div>
      <NewExpenses getNewExpenseData={getNewExpenseData}></NewExpenses>
      <Expenses
        expenses={expenses}
        func={(id) => setExpenses(expenses.filter((x) => id != x))}
      ></Expenses>
    </div>
  );
}

export default App;
